Card card[100000], another[100000];
scanf("%d", &n);
for (int i = 0; i < n; i++) {
scanf("%s %d", s, &card[i].num);
card[i].suit = s[0];
another[i] = card[i];
}
quickSort(card, 0, n - 1);
mergeSort(another, 0, n);
bool flag = false;
for (int i = 0; i < n; i++) {
if (card[i].suit != another[i].suit) {
flag = true;
break;
}
}
if (flag) {
