for (int i = 0; i < H; i++) {
int left = 0;
for (int j = 1; j < 6; j++) {
if (j == 5 || b[i][j] != b[i][j-1]) {
if (j >= left + 3) {
if (b[i][j-1] != -1) {
range tmp = {i, left, j-1};
deleted.push_back(tmp);
ans += b[i][j-1] * (j - left);
