int v, j;
for (int i = g; i < n; i++) {
v = A[i];
j = i - g;
while (j >= 0 && A[j] > v) {
swap(A[j + g], A[j]);
j -= g;
cnt++;
}

A[j + g] = v;
}
}

void shellSort(int A[], int n) {
vector<int> G;
