class CumulativeSum {
vector<ll> numbers;
vector<ll> sums;

public:
CumulativeSum(int n) {
numbers.resize(n);
sums.resize(n);
}

void set(int i, ll value) {
numbers[i] = value;
}

ll getSum(int i) {
if (i == -1) return 0;
if (i == sums.size()) return sums.back();
return sums[i];
}

ll getSectionSum(int start, int end) {
return getSum(end) - getSum(start - 1);
}

void build() {
for (int i = 0; i < numbers.size(); i++) {
sums[i] = getSum(i - 1) + numbers[i];
}
}

};

