for (int i = 0; Directions[i] != '\0'; i++) {
Roll(Directions[i]);
}
}

void Roll(const char Direction) {
int tmpTop = Num[Top];

switch (Direction) {
case'E':
Num[Top] = Num[Left];
Num[Left] = Num[Bottom];
Num[Bottom] = Num[Right];
Num[Right] = Num[tmpTop];
break;
case'N':
Num[Top] = Num[Front];
Num[Front] = Num[Bottom];
Num[Bottom] = Num[Rear];
Num[Rear] = tmpTop;
break;
case'S':
Num[Top] = Num[Rear];
Num[Rear] = Num[Bottom];
Num[Bottom] = Num[Front];
Num[Front] = tmpTop;
break;
case'W':
Num[Top] = Num[Right];
Num[Right] = Num[Bottom];
Num[Bottom] = Num[Left];
Num[Left] = tmpTop;
break;
}
}

