// s左->t右
ll dist_sltr = abs(x - sl + tr - sl);
// t右->s左
ll dist_trsl = abs(tr - x + tr - sl);
// s右->t左
ll dist_srtl = abs(sr - x + sr - tl);

turn_dist = min({dist_tlsr, dist_sltr, dist_trsl, dist_srtl});

cout << min(straight_dist, turn_dist) << endl;
}
}

