struct SegTree {
vector<int> node;
int n;
SegTree(int sz) {
n = 1;
while (sz > n) n *= 2;
node.resize(2 * n - 1, 0);
}
void add(int p, int x) {
p += n-1;
node[p] += x;
while (p) {
p = (p-1) / 2;
node[p] += x;
}
}
int get(int a, int b, int k = 0, int l = 0, int r = -1) {
if (r < 0) r = n;
if (b <= l || r <= a) return 0;
if (a <= l && r <= b) {
return node[k];
}
return get(a, b, k * 2 + 1, l, (l + r) / 2) + get(a, b, k * 2 + 2, (r + l) / 2, r);
}
};

